'use strict';
import React from 'react';
import Countdown from 'react-countdown';
import Logo from './Logo2.jpg';
import './topbar.css';
const Topbar = () => {
    return (
        <div className="topbar">
            <img src={Logo} alt='LOGO' ></img>
            <Countdown date={Date.now() + 60000} />,
        </div>
    );
};

export default Topbar;
